import React, { useHistory } from 'react';
import { Button } from 'react-bootstrap';


function AboutButton() {
  const history = useHistory();

  return (
    <Button variant="primary" onClick={() => history.push("/about")}>
      About
    </Button>
  );
}

export default AboutButton;
